"Reserved _Space(GB)", “Reserved _Space(GB)" - “Free Space(GB)" “Used _Space(GB)", “Free _Space(GB)”
from(
select
(select round(sum(bytes) /1048576/1024) from dba_data_files) “Reserved _Space(GB)",
(select round(sum(bytes)/1048576/1024) from dba_free_space) “Free Space(GB)”
from dual
);

